    - |-
      <h3>What are you worrying or anxious about?</h3>
      <ol><li>Make an assessment ( what is actually happening) not a judgement ( what you like or dislike, what you think is good or bad, or judge to be right or wrong )</li>
      <li>Whats the evidence according to your assessment?</li>
      <li>Write it down if possible</li>
      <li>The facts represent the actual situation and not what you may judge it to be or what you might like it to be</li>
      </ol>
