    - |-
      <h2>Worry</h2>
      <p>A feeeling of uneasiness caused by apprehension of possible misfortune or danger</p>
      <h2>Anxiety</h2>
      <p>Tension caused by the thought of something not working out as hoped or planned</p>
      <br />
    - |-
      <h3>Develop a strategy</h3>
      <p>Your strategy is your plan of action for dealing with the identified disturbance. It reflects the changes you can make in the way that you respond to such situations, whether people or events.</p>
      <p>In developing your strategy, it is important to remember that you can only take responsibility for, and therefore only change, yourself and the way that you allow situations and people to affect you.</p>
      <p>Having identified the facts of the situation, determine your desired outcomes:</p>
      <ul><li>What do you want to change?&#160;</li>
      <li>What resources do you have available?</li>
      <li>What resources can you develop?</li>
      <li>How can you use your resources now and in the future to&#160;facilitate change?</li>
      <li>When can you begin to make changes?</li>
      </ul>
      <p>Write it down if possible</p>
      <p>Using your resources and strategy, begin to respond rather than react to the situation.</p>
      <p>Observe the changes as they occur.</p>
