    - "<p><img src=\"/system/images/BAhbBlsHOgZmSSIlMjAxMS8xMC8yNi8yM181NF80Ml8yNzhfTXlFUS5qcGcGOgZFVA/MyEQ.jpg\" title=\"My Eq\" alt=\"My Eq\" rel=\"225x255\" width=\"640\" height=\"323\" />Emotions are an integral part of how think, reason, engage and communicate from day to day.  Emotional intelligence is a measure of how effectively we manage the interplay between thought and emotion, both for ourselves and when interacting with others.  When our emotions are appropriately expressed and balanced, we make better decisions, our problem solving abilities improve, and we can cope with change and life\xE2\x80\x99s challenges more effectively.  My EQ leads you through a practical five step process to help you increase self awareness and social awareness, improving self management and enhancing your relationship management skills.</p>"
