    - "<p>Every year a significant amount of productive business time is lost as a result of workplace injuries.  Even in a seemingly safe environment such as an office or call centre, people who spend a significant amount of time sitting at a desk or using a computer are at risk from a variety of common complaints and potential injuries.<br />Many of us have suffered from problems such as back pain, headaches, fatigue or stress, which reduces performance at work.  In contrast, employees who are healthy and well are likely to be more productive. For example, a recent study by Medibank Private found that:<br />\xE2\x80\xA2\tHealthy employees are nearly three times more productive than unhealthy employees<br />\xE2\x80\xA2\tUnhealthy employees take up to nine times more sick leave than their healthy colleagues<br />\xE2\x80\xA2\tPoor employee health and absenteeism costs Australian businesses $7 billion a year<br />For more statistics from the Medibank Private study or for more articles on workplace health, click on Workplace Health Articles below.<br />Employers continue to look for new ways to help their staff avoid or mitigate these problems, as they are aware of the beneficial impact this has upon employee welfare, engagement and productivity.  The My 5 program is an ideal way to invest in the health and wellness of your employees.<br />The program has been designed with corporate use specifically in mind.  The program is entirely web-based, allowing it to be rapidly deployed in your workplace, with no installation required.<br />In addition, My 5 offers employers customised reporting and expert assistance with the analysis and interpretation of reports on the health and wellness of your workforce.</p>"
