    - "<h2>My 5 was founded by Tim Norris, an internationally accredited practitioner who has 20 years\xE2\x80\x99 experience in the fields of natural health and fitness.</h2>\r\n\
      <p>Tim worked in one of the UK's leading health clubs as a personal trainer and Pilates teacher for over 7 years.  His year as a health consultant and bodywork practitioner at the BBC in 2003 inspired him to continue his work in the corporate workplace to enhance computer users' wellbeing. </p>\r\n\
      <p>Tim became aware of the need to address more effectively the typical complaints and issues that presented within a workplace.  Together with a number of highly qualified and experienced practitioners, he has been able to structure and develop the My 5 program to significantly alleviate the aches and pains commonly associated with extended computer usage.</p>\r\n\
      <p>Tim's experience in the corporate workplace is supported by extensive training and qualifications in a range of natural health modalities, including:</p>\r\n\
      <ul><li>    Fitness consultant</li>\r\n\
      <li>Sports therapy, rehabilitation and massage</li>\r\n\
      <li>Pilates</li>\r\n\
      <li>Acupuncture</li>\r\n\
      <li>Bowen technique</li>\r\n\
      <li>Kinesiology</li>\r\n\
      <li>Bio-energetics</li>\r\n\
      </ul><p style=\"font-style: italic;\">\"I\xE2\x80\x99m passionate about helping people to learn more about what causes their day to day health and wellness problems.  By inspiring people to understand their body\xE2\x80\x99s needs better, I can empower them to take more responsibility for their own wellbeing.  I see the My 5 software program as one of the ways I can achieve this.\" </p>"
