      <h2>Christine Ammann, Kinesiologist, SA</h2>
      <p>I love the My5 program as it incorporates a quick fix for everyone at any time, combining five very powerful modalities that work extremely well together.  When doing my administration work I often spend long periods of time sitting in front of my computer or marking assignments, and I guess, like most people, forget to take a break every so often.  By the end of the day of course, I end up with sore shoulder and neck muscles and weary eyes!  Having the program loaded onto my computer with the timely reminder set - I can relax and focus on my work until I am told what to do!  Being able to choose from different techniques without much fuss is great and improves my productivity - plus I still have enough energy left at the end of the day to spend time with my family without being tired, grumpy or sore - laugh!</p>
      <h2>Angela Stott, La Source International</h2>
      <p>When looking at options where we wanted to not only retain our staff but also promote well being in the work place, we were finding it a challenge to find a concept that would really work without taking up too much employee time.  Once we signed up to the program, we were instantly impressed with the ease of functionality of the program, the appeal to our employees and also the sheer professionalism of it all.  It is a seamless journey for the user and a valuable tool for any company looking to invest that little extra in their team.</p>
      <h2>Mimi Fong, Amicas Global pty</h2>
      <p>My 5 impressed me with its innovative yet simple approach to wellness in the workplace. It takes the basic principle of " Healthier employees equals greater productivity levels" and transforms this into easy to follow exercises which can be done anywhere in the workplace. My 5 has made a tangible difference to my business particularly in boosting concentration and alertness levels throughout the day. It is a must for any organisation serious in their commitment towards maintaining and enhancing the health and wellbeing of their most valuable assets - their employees.</p>
