    - About page part one
    - "<p>My 5 reminds you to take a few minutes out of the day to look after YOU.  Take five minutes to take a break from your work \xE2\x80\x93 to stretch, exercise, re-energise and re-focus.&#160; In a world where we are all working harder and longer, My 5 provides you with the tools and inspiration to help you do more to look after yourself whether at work and at home.&#160; Just as anti-virus software offers protection for the smooth running and health of your computer, My 5 software provides health and wellness solutions for you.</p>\r\n\
      <p>Employers are increasingly concerned with the wellbeing of their employees and searching for ways to make a difference.  My 5 offers practical help with day to day workplace health and wellness issues via My 5 online.</p>\r\n\
      <p>The number five has a great significance in our lives.  It\xE2\x80\x99s through our five senses that we experience life.  In Eastern medicine, there are five elements (earth, fire, water, metal and wood).  The number five also represents the balance point, embodying the characteristics of health, creativity, versatility and adaptability to change.</p>"
