    - "<h2>My body... My life... My 5</h2>\r\n\
      <p>Our vision embodies our commitment to helping you get more out of your life \xE2\x80\x93 both at work and at play.&#160;  Long hours spent sitting or using a computer can place a significant strain on your body.  We know this, and look to offer you welcome respite for mind and body.</p>\r\n\
      <p>My 5 's mission is to empower each individual to manage their own health and wellbeing.  In particular, My 5 offers:</p>\r\n\
      <ul><li>    Products</li>\r\n\
      <li>Services</li>\r\n\
      <li>Education and information</li>\r\n\
      <li>Inspiration and motivation</li>\r\n\
      </ul>\r\n\
      <p>All of these are designed to help you enhance your health and wellbeing.</p>"
