    - "<h3>1.              What information do we collect?</h3>\r\n\
      <p>We collect information from you when you register on our site, place an order, subscribe to our newsletter, respond to a survey or fill out a form.  When ordering or registering on our site, as appropriate, you may be asked to enter your name, e-mail address, mailing address or credit card information. You may, however, visit our site anonymously.</p>\r\n\
      <h3>2.              What do we use your information for?</h3>\r\n\
      <p>Any of the information we collect from you may be used in one of the following ways:</p>\r\n\
      <ul><li>To personalize your experience \xE2\x80\x93 your information helps us to better respond to your individual needs</li>\r\n\
      <li>To improve our website \xE2\x80\x93 we continually strive to improve our website offerings based on the information and feedback we receive from you</li>\r\n\
      <li>To improve customer service \xE2\x80\x93 your information helps us to more effectively respond to your customer service requests and support needs</li>\r\n\
      <li>To process transactions \xE2\x80\x93 your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested</li>\r\n\
      <li>To administer a contest, promotion, survey or other site feature</li>\r\n\
      <li>To send periodic emails \xE2\x80\x93 the email address you provide for order processing, will only be used to send you information and updates pertaining to your order and to My 5 Online and related services.  If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.</li>\r\n\
      </ul><h3>3.              How do we protect your information?</h3>\r\n\
      <p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.<br />We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our database to be only accessed by those authorized with special access rights to our systems, and are required to keep the information confidential.  After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.</p>\r\n\
      <h3>4.              Do we use cookies?</h3>\r\n\
      <p>My 5 uses cookies to understand and save your preferences for future visits and compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future. We may contract with third-party service providers to assist us in better understanding our site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.  Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information</p>\r\n\
      <h3>5.              Do we disclose any information to outside parties?</h3>\r\n\
      <p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\r\n\
      <h3>6.              Third party links</h3>\r\n\
      <p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\r\n\
      <h3>7.              California Online Privacy Protection Act Compliance</h3>\r\n\
      <p>Because we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.</p>\r\n\
      <p>As part of the California Online Privacy Protection Act, all users of our site may make any changes to their information at anytime by logging into their control panel and going to the 'Edit Profile' page.</p>\r\n\
      <h3>8.              Children\xE2\x80\x99s Online Privacy Protection Act Compliance</h3>\r\n\
      <p>We are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.</p>\r\n\
      <h3>9.              Online Privacy Policy Only</h3>\r\n\
      <p>This online privacy policy applies only to information collected through our website and not to information collected offline.</p>\r\n\
      <h3>10.          Other information</h3>\r\n\
      <p>Please also visit our <a href=\"/home/about-my-5/terms-and-conditions--2\" title=\"Terms and Conditions\">Terms and Conditions\r\n\
      </a> section establishing the use, disclaimers, and limitations of liability governing the use of our website at http://www.my5.com.au</p>\r\n\
      <h3>11.          Your Consent</h3>\r\n\
      <p>By using our site, you consent to our web site privacy policy.<br />If we decide to change our privacy policy, we will post those changes on this page, and/or update the Privacy Policy modification date below.  This policy was last modified on 27/10/2011</p>\r\n\
      <h3>12.          Contacting Us</h3>\r\n\
      <p>If there are any questions regarding this privacy policy you may contact us by email to support@my5.com.au</p>"
